    def Cha_But_Ok(self, event):  # wxGlade: MyFrame.<event_handler>
        global share_df
        global start_date
        global end_date
        Stock_Chart.plt.close()
        Stock_TA.plt.close()
        Stock_Pred.plt.close()
        share_df=Data_Collection.Stock_df(stock,start_date,end_date)
        if chart_sel=='CANDLE STICK':
            Stock_Chart.CandleStick(share_df)
        if chart_sel=='BAR':
            Stock_Chart.Bar_Plot(share_df)
        if chart_sel=='LINE':
            Stock_Chart.Line_Plot(share_df)
